import Menu from './pages/Menu';
import Cart from './pages/Cart';
import OrderPage from './pages/Order';
import Checkout from './pages/Checkout';

const App = () => {
  return (
  <Router>
    <Routes>
      <Route exact path='/' element={<Home />}></Route>
      <Route exact path='/menu' element={<Menu />}></Route>

    </Routes>
  </Router>
  );
};

export default App;
